          "id": "bb2f668e04dfb00003079ac1b44f9ed39bc93206",
          "message": "‚ú® feat(repository): implement composite LIMIT config items (ADR-114) (#285)\n\n## Summary\n\n- Implement ADR-114 composite design for LIMIT configuration records\n- Consolidate N per-limit items into 1 composite item per config level\n- Reduce cache-miss cost from 2 RCU to 1.5 RCU, write cost from 5 WCU to\n1 WCU\n- Add `l_*` attribute prefix for composite limit fields (cp, bx, ra, rp)\n- Create migration script for hard cutover to 0.8.0 schema\n\n## Test plan\n\n- [x] Unit tests pass (1117 tests)\n- [x] Integration tests pass (13 tests)\n- [x] E2E tests pass (18 passed, 1 skipped - LocalStack limitation)\n- [x] Patch coverage ‚â•95% (96%)\n- [x] Pre-commit hooks pass (ruff, ruff-format, mypy)\n\nCloses #270\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
