          "id": "41e51634814d3426748e6c0ebe4258ca321379a6",
          "message": "‚ú® feat(limiter): add refill-based TTL for default-limit buckets (#291)\n\n## Summary\n\n- Add `bucket_ttl_refill_multiplier` parameter to\nRateLimiter/SyncRateLimiter constructors (default: 7)\n- Buckets using system/resource defaults get TTL = `now +\n(max_time_to_fill √ó multiplier)`\n- Buckets with entity-level custom limits persist indefinitely (no TTL)\n- Config source tracking via `_resolve_limits()` returning `(limits,\nconfig_source)` tuple\n- LeaseEntry tracks `_has_custom_config` for TTL decisions at commit\ntime\n- Set multiplier to 0 to disable refill-based TTL entirely\n\n### Four-Level Config Hierarchy (ADR-118)\n\nExtended limit resolution from 3-tier to 4-tier:\n- Entity (resource-specific) ‚Üí Entity (`_default_`) ‚Üí Resource ‚Üí System\n‚Üí Override\n\n### Bucket TTL Strategy (ADR-119)\n\n- TTL = `max_time_to_fill √ó multiplier` where `time_to_fill = (capacity\n/ refill_amount) √ó refill_period`\n- Custom entity limits: no TTL (persist indefinitely)\n- Default limits (system/resource/entity `_default_`): TTL applied\n\n### Bucket Param Sync (ADR-120)\n\nWhen `set_limits()` updates entity config, existing bucket static\nparameters are synchronized.\n\n## Test plan\n\n- [x] Unit tests verify TTL presence for default-limit buckets\n- [x] Unit tests verify TTL absence for custom-limit buckets\n- [x] Unit tests verify TTL removal when upgrading to custom limits\n- [x] Unit tests verify TTL added when downgrading from custom limits\n- [x] Unit tests verify multiplier=0 disables TTL\n- [x] Unit tests verify slow-refill limits get longer TTL (time-to-fill\nbased)\n- [x] Sync limiter tests verify parity with async behavior\n- [x] Integration test verifies TTL downgrade workflow against\nLocalStack\n\n## Issues Closed\n\nCloses #271 - Refill-based TTL for default-limit buckets (main issue)\nCloses #293 - TTL set after deleting entity config (subissue of #271)\nCloses #296 - TTL calculation uses time-to-fill instead of refill_period\nCloses #297 - Entity-level `_default_` config fallback in limit\nresolution\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
