          "message": "‚ú® feat(limiter): add TTL-based retention for usage snapshots and audit records (#300)\n\n## Summary\n- Rename `retention_days` to `usage_retention_days` in StackOptions for\nclearer semantics distinguishing usage snapshot retention from\nCloudWatch log retention\n- Add `audit_retention_days` parameter to StackOptions (default: 90\ndays) for configurable audit record TTL in DynamoDB\n- Store audit retention config in DynamoDB system config on deployment\nwith dynamic TTL calculation for audit events\n- Add `--audit-retention-days` CLI flag to deploy command\n- Add tests verifying entity metadata and config records do NOT have TTL\n(intentional configuration must not auto-delete)\n\n## Test plan\n- [x] Unit tests pass for StackOptions validation and audit TTL\ncalculation\n- [ ] Integration tests verify audit records get TTL attribute\n- [x] Verify entity metadata/config records explicitly have no TTL\n\nCloses #234\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
