          "message": "üêõ fix(infra): rename IAM policies for clarity and fix permissions (#307) (#310)\n\n## Summary\n- Renamed `AppPolicy` ‚Üí `AcquireOnlyPolicy` (suffix `-acq`) and\n`AdminPolicy` ‚Üí `FullAccessPolicy` (suffix `-full`) to set correct\nexpectations about policy scope\n- Added missing permissions: `BatchGetItem` to `ReadOnlyPolicy`, `Scan`\nand `DescribeTable` to `FullAccessPolicy`\n- Added ADR-121 documenting the rename decision and rationale\n- Updated all documentation (CLAUDE.md, deployment, CloudFormation,\nproduction guides) and unit tests\n\n## Test plan\n- [x] `uv run pytest tests/unit/test_cfn_iam_parity.py -v` passes with\nnew policy names\n- [x] `uv run pytest tests/unit/test_models.py -v` passes with updated\nmodel defaults\n- [x] `uv run cfn-lint src/zae_limiter/infra/cfn_template.yaml` passes\n- [x] Review ADR-121 for completeness\n\nCloses #307\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
