          "id": "fe62cf574aeb1b266e84b762a5d4d4e136b9993d",
          "message": "‚ö° perf(limiter): write token consumption to DynamoDB on acquire enter (#309) (#312)\n\n## Summary\n- Moves DynamoDB write from context exit (`_commit`) to context enter\n(`_commit_initial`) so consumed tokens are immediately visible to\nconcurrent callers, eliminating the phantom consumption window\n- Adds `_commit_adjustments()` for post-enter deltas\n(adjust/consume/release); no-op when no adjustments were made during the\ncontext\n- Adds compensating `_rollback()` that restores initially consumed\ntokens on error, with failure logging to avoid masking the original\nexception\n- Adds `write-on-enter.md` rule to document the new invariant\n\n## Test plan\n- [x] Existing unit tests updated and passing (`test_limiter.py`,\n`test_sync_limiter.py`)\n- [x] New tests for write-on-enter paths: `_commit_initial`,\n`_commit_adjustments`, `_rollback` compensating writes\n- [x] Integration tests with LocalStack\n- [x] Verify cascade flow writes both entity + parent on enter\n\nCloses #309\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
