          "id": "d99b7daeeac00539ff0add9f30268cf7ecdafc9d",
          "message": "‚ôªÔ∏è refactor(repository): native sync implementation via AST transformation (#308)\n\n## Summary\n\n- Replace event-loop-wrapper `SyncRateLimiter` with native sync code\ngenerated via AST transformation from async sources\n- Add `scripts/generate_sync.py` AST transformer (unasync pattern used\nby httpx, httpcore) producing 7 sync modules and 5 sync test files\n- Integrate generation into build (Hatch), pre-commit, and CI\n(`verify-sync` job) to keep generated code in sync\n- Auto-generate sync unit tests from async test sources, plus add\ntargeted sync-coverage tests\n- Enable Gevent/Eventlet compatibility by using native boto3 (blocking\nI/O becomes cooperative via monkey-patching)\n\n## AST Transformer\n\n`scripts/generate_sync.py` performs source-to-source transformation:\n\n| Transformation | Example |\n|----------------|---------|\n| `async def` / `await` | Stripped to plain `def` / direct calls |\n| `async with` / `async for` | Converted to `with` / `for` |\n| `aioboto3` | Replaced with `boto3` |\n| `aiohttp` session methods | Replaced with sync equivalents |\n| Class/module renaming | `Repository` ‚Üí `SyncRepository`, `RateLimiter`\n‚Üí `SyncRateLimiter` |\n| Import rewriting | Async imports ‚Üí sync counterparts |\n| Enum identity preservation | `OnUnavailable.ALLOW` kept as-is (shared\nmodel) |\n| Protocol generation | `RepositoryProtocol` ‚Üí `SyncRepositoryProtocol`\n|\n\n## Generated Source Files (do not edit)\n\n| Generated File | Source |\n|----------------|--------|\n| `sync_repository_protocol.py` | `repository_protocol.py` |\n| `sync_repository.py` | `repository.py` |\n| `sync_limiter.py` | `limiter.py` |\n| `sync_lease.py` | `lease.py` |\n| `sync_config_cache.py` | `config_cache.py` |\n| `infra/sync_stack_manager.py` | `infra/stack_manager.py` |\n| `infra/sync_discovery.py` | `infra/discovery.py` |\n\n## Generated Test Files (do not edit)\n\n| Generated Test | Source |\n|----------------|--------|\n| `test_sync_limiter.py` | `test_limiter.py` |\n| `test_sync_repository.py` | `test_repository.py` |\n| `test_sync_stack_manager.py` | `test_stack_manager.py` |\n| `test_sync_discovery.py` | `test_discovery.py` |\n| `test_sync_config_cache.py` | `test_config_cache.py` |\n\n## Build & CI Integration\n\n- **Hatch build hook** runs `generate_sync.py` before wheel/sdist\npackaging\n- **Pre-commit hook** verifies generated code matches current async\nsource\n- **CI `verify-sync` job** blocks PRs with stale generated code\n- **Coverage exclusion** for generated sync files (coverage measured on\nasync source)\n- `ruff` added as build dependency for post-generation formatting\n\n## Other Changes\n\n- **ADR-121** documents the architectural decision for native sync via\nunasync\n- **CLAUDE.md** updated with sync generation workflow and file listings\n- **API docs** updated to reference `sync_limiter` module\n- **Async source cleanup** in `limiter.py` (removed old wrapper class,\n~600 lines)\n- **Benchmark fixtures** updated for native `SyncRateLimiter`\n- Minor fixes to `discovery.py`, `stack_manager.py`, `lease.py`,\n`repository.py` for generator compatibility\n\n## Test plan\n\n- [ ] All unit tests pass (`uv run pytest tests/unit/ -v`)\n- [ ] mypy passes (`uv run mypy src/zae_limiter`)\n- [ ] CI `verify-sync` job passes (generated code is up-to-date)\n- [ ] Import test: `from zae_limiter import SyncRateLimiter,\nSyncRepository, SyncLease`\n- [ ] Regeneration is idempotent: `hatch run generate-sync` produces no\ndiff\n- [ ] Pre-commit hook catches stale generated code\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
