          "id": "c2be320a986cad2b37323814b1274f03589abc99",
          "message": "üêõ fix(benchmark): use non-cascade entity in test_acquire_without_cascade (#319)\n\n## Summary\n- Fixed `test_acquire_without_cascade` to use an entity without cascade\nenabled (`cascade-parent`)\n- Both benchmark tests were incorrectly using the same entity\n(`cascade-child`) which has `cascade=True`\n- This caused both tests to measure identical cascade overhead instead\nof comparing cascade vs non-cascade performance\n- Updated docstrings to clarify what each test measures\n- Benchmark results now correctly show cascade overhead: without cascade\n(17.32ms mean baseline) vs with cascade (31.06ms mean, 1.79x slower)\n\n## Test plan\n- [x] Run benchmark suite to verify correct cascade overhead measurement\n- [x] Verify `test_acquire_without_cascade` uses `cascade-parent` (no\nparent)\n- [x] Verify `test_acquire_with_cascade` uses `cascade-child` (has\nparent + cascade=True)\n\nCloses #292\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
