          "message": "‚ö° perf(cache): BatchGetItem optimization for config resolution (#298) (#323)\n\n## Summary\n- Add `Repository.batch_get_configs()` method that fetches all 4 config\nhierarchy levels (entity, entity default, resource, system) in a single\n`BatchGetItem` call instead of 4 sequential `GetItem` calls\n- Integrate batch config resolution into `ConfigCache` with fallback to\nsequential `GetItem` on partial failure\n- Add `ConfigSource` and `OnUnavailableAction` Literal type aliases for\ntype-safe config resolution\n- Add benchmark tests to track cold-cache config resolution RCU/latency\n\n## Benchmark Results: BatchGetItem vs Sequential GetItem (#298)\n\nCold-cache config resolution (moto, no config cache, unique entity IDs\nper iteration):\n\n| Approach | Mean | Median | OPS | Relative |\n|----------|------|--------|-----|----------|\n| **Batched** (1 BatchGetItem) | 5.25ms | 5.18ms | 190/s | 1.0x |\n| **Sequential** (4 GetItem) | 8.26ms | 8.14ms | 121/s | **1.57x\nslower** |\n\n### API Call Reduction\n\n| Path | Config Reads | Total BatchGetItem |\n|------|-------------|--------------------|\n| Before (sequential) | 4 GetItem (entity, entity_default, resource,\nsystem) | 1 (buckets) |\n| After (batched) | 1 BatchGetItem (4 config keys) | 2 (configs +\nbuckets) |\n| Version check | 1 GetItem | unchanged |\n\n**Note:** With moto (in-process mock), the improvement is ~37% because\nthere's no real network latency. On real DynamoDB, eliminating 3 network\nround trips would yield a significantly larger improvement proportional\nto network RTT (typically 2-5ms per call).\n\n### Benchmark command\n\n```bash\nuv run pytest tests/benchmark/test_operations.py -o \"addopts=\" -v --benchmark-only -k \"config_resolution\"\n```\n\n## Test plan\n- [x] Unit tests for `batch_get_configs()` in `test_repository.py` and\n`test_sync_repository.py`\n- [x] Unit tests for batch config cache integration in\n`test_config_cache.py` and `test_sync_config_cache.py`\n- [x] Edge case coverage: partial results, empty responses,\ndeserialization\n- [x] Benchmark test in `test_capacity.py` for cold-cache config\nresolution\n- [x] Verify `uv run pytest tests/unit/ -v` passes (1730 tests)\n- [x] Verify `uv run mypy src/zae_limiter` passes\n\nCloses #298\nCloses #325\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
