          "id": "626beb70e1556fd62854fe16537c076db5ed7619",
          "message": "‚ö° perf(limiter): speculative UpdateItem to skip read round trip (#326)\n\n## Summary\n- Add speculative `UpdateItem` fast path to `acquire()` that skips the\nread round trip when tokens are plentiful (steady-state case)\n- Non-cascade acquires drop from 2 round trips (1 RCU + 1 WCU) to 1\nround trip (0 RCU + 1 WCU); cascade acquires drop from 2 RT to 2 RT with\n0 RCU + 2 WCU\n- Denormalize `cascade` and `parent_id` into composite bucket items so\n`ReturnValues=ALL_NEW` reveals cascade info without a separate read\n- New `Repository.speculative_consume()` method issues conditional\n`UpdateItem` with `ADD -consumed` and `tk >= consumed` guard; returns\n`SpeculativeResult` with deserialized bucket state\n- Feature is enabled by default (`speculative_writes=True`); data\npopulation (cascade/parent_id in buckets) happens regardless of flag\n- On condition failure, checks whether refill would satisfy the request:\nraises `RateLimitExceeded` (fast rejection, saves 1 RCU) or falls back\nto slow path\n- Cascade failure compensates child via `write_each` before falling back\nto full transact_write slow path\n- Eagerly reconcile bucket limit fields, TTL, and stale attributes when\n`set_limits()` or `delete_limits()` modifies entity-level config,\nensuring the speculative path operates with correct bucket state (#327)\n\n## Test plan\n- [x] Unit tests for speculative success (single + multi-limit)\n- [x] Unit tests for fallback on condition failure and missing bucket\n- [x] Unit tests for cascade speculative success and parent failure with\nchild compensation\n- [x] Unit tests for config change self-correction (new limit not in\nbucket)\n- [x] Unit tests for child refill-helps fallback path\n- [x] Unit tests for bucket reconciliation (TTL removal on set_limits,\nTTL + stale attr removal on delete_limits, cache eviction)\n- [x] Integration test for TTL downgrade on config deletion\n- [x] Benchmark tests demonstrating 0 RCU on speculative happy path\n- [x] Sync variants generated and passing pre-commit\n- [x] Integration tests with LocalStack\n- [x] E2E tests passing (LocalStack + AWS)\n- [x] CLAUDE.md updated to reflect default-on behavior\n\nCloses #315\nCloses #327\nCloses #328\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
