          "id": "c18ef3b03898afcf9e4ff5235ef81e281ad1fefe",
          "message": "‚ôªÔ∏è refactor(repository): move resolve_limits and config cache to Repository (ADR-122) (#330)\n\n## Summary\n\nMove `resolve_limits()` and `ConfigCache` from `RateLimiter` to\n`Repository`, per ADR-122. This makes config resolution a backend\nconcern so each backend can use native strategies (e.g., `BatchGetItem`\nfor DynamoDB, SQL `UNION ALL` for Postgres, Lua scripts for Redis).\n\n**Key changes:**\n- Add `resolve_limits(entity_id, resource)` and\n`resolve_on_unavailable()` to `RepositoryProtocol`\n- Move `ConfigCache` into `Repository` as an internal implementation\ndetail\n- `config_cache_ttl` parameter moves from `RateLimiter` to `Repository`\nconstructor\n- Cache management (`invalidate_config_cache()`, `get_cache_stats()`)\nnow on `Repository`\n- DynamoDB implementation uses `BatchGetItem` for all 4 config keys in a\nsingle round trip, with sequential fallback\n- ADR-122 created, accepted, and supersedes ADR-103\n\n**Bug fix included:**\n- `_resolve_on_unavailable()` was calling `get_system_defaults()`\ndirectly, bypassing config cache (~0.5 RCU wasted per `acquire()` when\n`on_unavailable` not passed). Now routed through cached\n`resolve_on_unavailable()`. Fixes #333\n\n## Test plan\n- [x] Unit tests pass (1823 tests)\n- [x] Doctests pass (315 tests)\n- [x] Integration tests pass against LocalStack (49 tests)\n- [x] E2E tests pass against LocalStack (18 tests)\n- [x] E2E tests pass against real AWS (22 passed, 1 xfailed)\n- [x] Benchmarks pass (moto: 53, LocalStack: 15)\n- [x] Sync code generation up-to-date\n- [x] MkDocs builds in strict mode\n- [x] Documentation updated for API changes\n\nCloses #329\nFixes #333\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
