          "id": "52d260ec118a0ad43e4a08ea364d1331429947f8",
          "message": "‚ö° perf(aggregator): proactive bucket refill from DynamoDB Streams (#317) (#335)\n\n## Summary\n\n- Add aggregator-assisted bucket refill to the Lambda stream processor\n(`processor.py`), keeping speculative writes on the 1-RT fast path by\nproactively topping up token buckets for active entities\n- Introduce shared stream record parsing (`ParsedBucketRecord`,\n`ParsedBucketLimit`) and refill state aggregation (`BucketRefillState`,\n`LimitRefillInfo`) to compute per-bucket consumption rate and project\nwhether tokens will be exhausted before the next batch window\n- `try_refill_bucket()` uses `ADD tk +refill` (commutative with\nconcurrent speculative writes) with an optimistic lock on `rf`\n(`ConditionExpression: rf = :expected_rf`) to prevent double-refill with\nthe client slow path\n- Update `lambda_builder.py` to include `bucket.py`, `models.py`, and\n`exceptions.py` stubs in the Lambda deployment package (required for\n`refill_bucket()` math)\n- Update `ProcessResult` and handler response to include\n`refills_written` count\n- Update CLAUDE.md with aggregator refill documentation, DynamoDB writer\ntable, and access pattern details\n\n## Test plan\n\n- [x] Unit tests cover: refill triggers when projected tokens\ninsufficient, skips when tokens sufficient, handles\n`ConditionalCheckFailedException` gracefully, consumption rate\ncalculation from stream event deltas\n- [x] Integration test (`tests/integration/test_bucket_refill.py`)\nverifies end-to-end: speculative write -> stream event -> aggregator\nrefill -> next speculative write succeeds without slow path\n- [x] Verify `--no-aggregator` deployments are unaffected (no behavioral\nchange without the Lambda)\n- [x] Run `uv run pytest tests/unit/test_processor.py\ntests/unit/test_handler.py -v`\n- [x] Run `uv run pytest tests/integration/test_bucket_refill.py -v`\n(requires LocalStack)\n\nCloses #317\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
