          "id": "54cf0c96e48e4a22ed5f5f7d1132b690777ed4a4",
          "message": "‚ö° perf(limiter): cache entity metadata for parallel cascade speculative writes (#318) (#338)\n\n## Summary\n- Add in-memory entity metadata cache (`{entity_id -> (cascade,\nparent_id)}`) to `Repository` for parallel cascade speculative writes\n- When cache hit + cascade, child and parent speculative `UpdateItem`s\nare issued concurrently via `asyncio.gather`, halving wall-clock latency\nfrom 2 sequential round trips to 1 parallel round trip\n- Cache is populated transparently from `ALL_NEW` responses and entity\nlookups; no TTL needed since cascade/parent_id are immutable\n- Nest parent `SpeculativeResult` inside child result via new\n`parent_result` field on `SpeculativeResult`, keeping\n`RepositoryProtocol` surface minimal per ADR-122\n- Refactor `_try_speculative_fast_path` in `RateLimiter` to handle\nparallel results, including partial failure compensation and a new\n`_handle_nested_parent_failure` helper\n\n## Benchmark results (real AWS DynamoDB, us-east-1)\n\n| Test | Min | Mean | Median | OPS | vs Non-cascade |\n|------|-----|------|--------|-----|----------------|\n| Non-cascade speculative | 11.9ms | 13.5ms | 13.2ms | 73.9/s | baseline\n|\n| **Cascade warm (parallel)** | 13.4ms | 15.1ms | 14.9ms | 66.2/s | +12%\n|\n| Cascade cold (sequential) | 25.2ms | 27.0ms | 26.8ms | 37.0/s | +100%\n|\n\n- Warm cascade is nearly as fast as non-cascade ‚Äî only ~1.7ms (12%)\noverhead for writing to two entities in parallel via\n`ThreadPoolExecutor`\n- Cold cascade is 2x slower ‚Äî sequential slow path adds a full extra\nround trip\n- The parallel path effectively hides the parent write behind the child\nwrite latency\n\n## Test plan\n- [x] Unit tests cover cache miss populates cache on first speculative\nsuccess\n- [x] Unit tests cover cache hit with `cascade=False` (single\nspeculative write)\n- [x] Unit tests cover cache hit with `cascade=True` triggers parallel\n`asyncio.gather`\n- [x] Unit tests cover parallel write partial failure (child success +\nparent fail) with compensation\n- [x] Unit tests cover parallel write where child fails + parent\nsucceeds, parent is compensated\n- [x] Unit tests cover zero-amount bucket skip in parallel speculative\npaths\n- [x] Sync variants generated and verified via `pre-commit run\ngenerate-sync --all-files`\n- [x] Benchmark tests demonstrate 1 RT wall clock for cascade entities\non cache hit path\n\nCloses #318\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
