          "id": "38a0e689f753e07eddd3293081c4149d98b1650f",
          "message": "‚úÖ test(benchmark): add speculative vs baseline AWS latency comparison (#331) (#339)\n\n## Summary\n- Parametrize `aws_benchmark_limiter` fixture with\n`speculative_writes=False` (baseline) and `True` (speculative) so every\nlatency test runs twice for side-by-side comparison via\n`--benchmark-compare`\n- Fix 3 concurrent throughput/contention tests that referenced\nnon-existent `SyncRateLimiter._run` and `._limiter` by switching to\n`ThreadPoolExecutor` with direct sync `acquire()` calls\n- Add missing `policy_name_format=\"PowerUserPB-{}\"` to all\n`StackOptions` fixtures for consistency with the permission boundary\npattern\n\n## Test plan\n- [x] `pytest tests/benchmark/test_aws.py --run-aws -v --benchmark-only\n-o \"addopts=\"` passes with both baseline and speculative\nparametrizations\n- [x] `--benchmark-json=speculative.json` produces comparison-ready\noutput\n- [x] Concurrent tests (`test_concurrent_throughput_aws`,\n`test_contention_behavior_aws`,\n`test_cascade_concurrent_throughput_aws`) pass without `_run`/`_limiter`\nerrors\n\nCloses #331\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
