          "id": "ba12e2696c4eb8d9084d052d25edf46bc7320690",
          "message": "‚ú® feat(infra): add stack type tagging, discovery filtering, and CFN exports (#348)\n\n## Summary\n\n- Add `TYPE_TAG_KEY` to stack tags so limiter and load-test stacks can\nbe distinguished\n- Export `PermissionBoundaryArn`, `RoleNameFormat`, and `CodeBucketName`\nfrom CFN stack for use by dependent stacks (e.g., load testing)\n- Add `stack_type` field to `LimiterInfo` model\n- Add `stack_type` filter to `list_limiters()` in discovery\n- Export `role_name_format` from `StackOptions.to_cfn_params()`\n\n## Test plan\n\n- [x] Unit tests for `list_limiters(stack_type=\"limiter\")` filtering\n(async + sync)\n- [x] Pre-commit hooks pass (ruff, mypy, cfn-lint, partition check)\n- [x] 100% patch coverage\n- [x] CI passes\n\nCloses #341\nPart of #340\n\nü§ñ Generated with [Claude Code](https://claude.com/claude-code)",
