          "id": "728e8b9ded818fff1dd23aec6b81dcb96c2ce85b",
          "message": "‚ö° perf(repository): add configurable parallel_mode for SyncRepository (#349)\n\n## Summary\n\n- Add `parallel_mode` parameter to `SyncRepository` for configurable\ncascade execution strategy\n- Support four modes: `auto` (default), `gevent`, `threadpool`, `serial`\n- Auto mode silently selects optimal strategy: gevent (if\nmonkey-patched) ‚Üí serial (single-CPU) ‚Üí threadpool\n- Add `[bench]` extra with locust/gevent/docker dependencies\n- Add gevent marker and `pytest_ignore_collect` for xdist-incompatible\ngevent tests\n- Update `generate_sync.py` to transform `asyncio.gather` ‚Üí\n`_run_in_executor`\n- Parametrize AWS benchmark tests with parallel_mode variants\n\n## Test plan\n\n- [x] All 1871 unit tests pass\n- [x] Pre-push patch coverage passes (sync_*.py excluded from coverage\nby design)\n- [x] CI: verify gevent test step runs correctly\n- [x] CI: verify `--extra bench` installs correctly\n\nCloses #342\nPart of #340\n\nü§ñ Generated with [Claude Code](https://claude.com/claude-code)",
