          "id": "a472e1b1bdf2a696fd5d52181f479b43bbf1907f",
          "message": "‚ú® feat(load): add Locust base classes and example locustfiles (#350)\n\n## Summary\n\n- Add `zae_limiter.locust` module with `RateLimiterUser` base class and\n`RateLimiterSession` instrumented client\n- Add `RateLimiterSession` methods: `acquire()`, `available()`,\n`create_entity()`, `delete_entity()`, `set_limits()`, `delete_limits()`\n-- all fire Locust events with timing\n- Add shared `SyncRateLimiter` instance per `stack_name` with\nconfigurable boto3 connection pool (`BOTO3_MAX_POOL`)\n- Add 5 example locustfiles: `simple.py`, `max_rps.py`, `stress.py`,\n`llm_gateway.py`, `llm_production.py`\n- Add shared utilities: `LoadConfig`, `LoadDistribution`,\n`TrafficDistributor` (whale/spike/power-law)\n- Add comprehensive unit tests (61 test functions) for session, user\nlifecycle, and pool configuration\n\n## Locust integration\n\n`RateLimiterUser` is analogous to Locust's `HttpUser` -- it provides a\n`self.client` that wraps `SyncRateLimiter` and fires Locust request\nevents with timing on every operation.\n\n```python\nfrom zae_limiter.locust import RateLimiterUser\n\nclass MyUser(RateLimiterUser):\n    stack_name = \"my-limiter\"\n\n    @task\n    def do_acquire(self):\n        with self.client.acquire(\n            entity_id=\"user-123\",\n            resource=\"gpt-4\",\n            consume={\"rpm\": 1, \"tpm\": 500},\n            name=\"gpt-4/baseline\",\n        ):\n            pass\n```\n\nKey features:\n- Shared `SyncRateLimiter` across all users with same `stack_name`\n(class-level cache)\n- Configurable boto3 connection pool to avoid pool exhaustion under high\nconcurrency\n- `RateLimitExceeded` exceptions are reported as failures with\nretry-after metadata\n- Stack name from `--host` flag, class attribute, or `TARGET_STACK_NAME`\nenv var\n\n## Example locustfiles\n\n| Scenario | File | Pattern | Description |\n|----------|------|---------|-------------|\n| Simple | `simple.py` | Single resource, RPM | Baseline throughput\ntesting |\n| Max RPS | `max_rps.py` | Zero wait, back-to-back | Find ceiling\nthroughput |\n| LLM Gateway | `llm_gateway.py` | 8 models, RPM+TPM, adjustments |\nPost-hoc token reconciliation |\n| LLM Production | `llm_production.py` | Weighted tasks, load shapes |\n24hr daily + morning spike patterns |\n| Stress | `stress.py` | Whale/spike/power-law | Hot partition + burst\ntesting |\n\n## Changes\n\n| File | Description |\n|------|-------------|\n| `src/zae_limiter/locust.py` | `RateLimiterUser`, `RateLimiterSession`,\npool config (534 lines) |\n| `examples/locust/` | 5 locustfiles + shared config/distribution\nutilities |\n| `tests/unit/load/test_locust.py` | 61 test functions (780 lines) |\n| `pyproject.toml` | mypy override for `locust.*` imports |\n| `.pre-commit-config.yaml` | Add `locust` to mypy additional deps |\n\n## Test plan\n\n- [x] Unit tests pass (61 new tests in `tests/unit/load/test_locust.py`)\n- [x] Pre-commit hooks pass (ruff, mypy, cfn-lint)\n- [x] CI: verify unit tests pass\n- [x] CI: verify existing integration/e2e tests unaffected\n\nCloses #343\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
