          "message": "‚ú® feat(load): add infrastructure deploy/teardown for load testing (#355)\n\n## Summary\n- Add CloudFormation template for ECS Fargate + VPC + Lambda worker\ninfrastructure for distributed load testing\n- Add Docker image builder for Locust containers with ECR push support\n- Add Lambda deployment package builder using `aws-lambda-builders`\n- Add CLI commands (`deploy`, `teardown`, `list`) for managing load test\nstacks with interactive VPC/subnet selection\n- Inherits permission boundary and role name format from target limiter\nstack\n\n## Test plan\n- [x] Unit tests for `builder.py` (Docker image build/push, source\ndetection)\n- [x] Unit tests for `lambda_builder.py` (package assembly, requirements\nmerging)\n- [x] Unit tests for `cli.py` (deploy, teardown, list commands with\nmocked AWS)\n- [ ] Manual: `zae-limiter load deploy` against LocalStack or AWS\n\nCloses #352\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
