          "id": "f7f670840ea2517877e2266c1988506bd91318c9",
          "message": "‚ú® feat(loadtest): add cascade user classes for benchmark comparison (#359)\n\n## Summary\n- Add `MaxRpsCascadeUser` and `SimpleCascadeUser` classes to locustfiles\nfor benchmarking hierarchical rate limiting with `cascade=True` against\nstandalone entities\n- Replace `--user-classes` option with positional arguments in `loadtest\nrun` and `loadtest tune` CLI commands for ergonomic class selection\n- Open browser automatically when SSM tunnel is ready during `loadtest\nui`\n- Hide `--standalone` flag (internal implementation detail)\n\n## Test plan\n- [x] Unit test updated for positional user class args\n(`test_tune_with_user_classes`)\n- [x] Run `zae-limiter loadtest run <stack> -f locustfiles/max_rps.py\nMaxRpsCascadeUser` to verify positional args work\n- [x] Run `zae-limiter loadtest tune <stack> -f locustfiles/max_rps.py\nMaxRpsCascadeUser` to verify tune with class selection\n- [x] Verify `zae-limiter loadtest ui` opens browser when tunnel\nconnects\n\nCloses #346\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
