          "message": "‚ú® feat(repository): thread namespace_id through all call sites (#376)\n\n## Summary\n\n- Thread `self._namespace_id` (defaulting to `\"default\"`) through every\nPK/GSI-PK key builder call in `repository.py`, `config_cache.py`, and\n`processor.py`\n- Move `bucket_ttl_refill_multiplier` ownership from `RateLimiter` to\n`Repository`, removing it from the\n`RepositoryProtocol.reconcile_bucket_to_defaults()` signature\n- Namespace-scope internal caches: entity cache keyed by `(namespace_id,\nentity_id)`, config cache keyed by `(namespace_id, entity_id, resource)`\n- Update all unit, integration, and migration tests for the `\"default/\"`\nkey prefix and new signatures\n- Regenerate sync code (`sync_repository.py`, `sync_limiter.py`,\n`sync_config_cache.py`, `sync_repository_protocol.py`)\n\n## Test plan\n\n- [x] `uv run pytest tests/unit/ -v` passes with all existing tests\ngreen\n- [x] `uv run mypy src/zae_limiter/` passes with no new errors\n- [x] `hatch run generate-sync` produces no diff (sync files up-to-date)\n- [x] Integration tests pass against LocalStack (`pytest\ntests/integration/ -v`)\n\nCloses #365\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
