          "id": "bbc8120cb92bb63a318d4ac9f9c2be7223baf0a8",
          "message": "‚ú® feat(repository): add Builder pattern replacing StackOptions + with_options() (#379)\n\n## Summary\n\n- Add `RepositoryBuilder` with fluent API that absorbs all\n`StackOptions` fields, namespace resolution, and version management into\na single `await build()` call\n- Add `repo.namespace(name)` for multi-tenant scoping that shares boto3\nclient and caches with the parent repository\n- Set GSI4 attributes (`GSI4PK`, `GSI4SK`) on all 8 record creation\npaths (buckets, entity metadata, configs, version, audit, usage) for\nnamespace lookup support\n- Add `NamespaceNotFoundError` exception for missing/deleted namespaces\nduring `build()` or `namespace()` calls\n- Deprecate `StackOptions` (emits `DeprecationWarning`),\n`ensure_infrastructure()` as public API, and\n`strict_version`/`skip_version_check` on RateLimiter\n- Generate sync counterparts (`SyncRepositoryBuilder`, updated\n`SyncRepository`) via `generate-sync`\n\n## Test plan\n\n- [x] `uv run pytest tests/unit/test_repository_builder.py -v` ‚Äî builder\nmethod chaining, `build()` with/without infra options, namespace\nresolution, version management, `StackOptions` deprecation\n- [x] `uv run pytest tests/unit/test_namespace_scoping.py -v` ‚Äî\n`repo.namespace()` returns scoped repo sharing client + caches,\nnamespace ID caching, `NamespaceNotFoundError`\n- [x] `uv run pytest tests/unit/test_repository.py -v` ‚Äî GSI4 attributes\non all creation paths, speculative writes and adjustments do NOT set\nGSI4\n- [x] `uv run pytest tests/unit/test_sync_repository.py -v` ‚Äî sync\nbuilder and namespace parity\n- [x] `uv run pytest tests/unit/ -v` ‚Äî full unit test suite passes\n- [x] `uv run mypy src/zae_limiter/` ‚Äî no new type errors\n\nCloses #375\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
