          "id": "47df14c24907aaa2a87082611bfc59f1356204f7",
          "message": "üí• breaking(limiter)!: deprecate constructor params and delegate to Repository (#366) (#380)\n\n## Summary\n- Deprecate `RateLimiter` constructor parameters (`name`, `region`,\n`endpoint_url`, `stack_options`, `on_unavailable`, `auto_update`,\n`bucket_ttl_refill_multiplier`) with `DeprecationWarning`; the new API\nis `RateLimiter(repository=Repository(...))`\n- Remove dead code from `RateLimiter`: `_auto_update`,\n`_version_checked`, `_check_version()`, `_update_lambda()`,\n`_do_ensure_initialized()`, and other methods now owned by `Repository`\n- Forward deprecated business-logic params (`on_unavailable`,\n`bucket_ttl_refill_multiplier`) to the internally-created `Repository`\nfor backward compatibility\n- Add `resolve_on_unavailable()` and `delete_stack()` to `Repository` /\n`RepositoryProtocol`, moving ownership from limiter to repository\n- Convert `stack_name` and `table_name` on `RateLimiter` into deprecated\nproperties that delegate to `repository.stack_name`\n- Migrate all test fixtures to Repository-first pattern, removing\nreliance on deprecated constructor paths\n- Add test coverage for deprecated parameter forwarding,\n`delete_stack()`, and `resolve_on_unavailable()`\n\n## Test plan\n- [x] Unit tests pass (`tests/unit/test_limiter.py`,\n`tests/unit/test_repository.py`)\n- [x] Sync counterparts updated and passing\n(`tests/unit/test_sync_limiter.py`,\n`tests/unit/test_sync_repository.py`)\n- [x] Integration and e2e tests pass with LocalStack\n- [x] `hatch run generate-sync` produces up-to-date generated files\n- [x] `pre-commit run --all-files` passes\n\nCloses #366\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
