          "id": "1df0db4c2cf44ac3506a2e9f6bf5b0903599da83",
          "message": "‚ú® feat(infra): add namespace-scoped IAM policies with PrincipalTag conditions (#370) (#387)\n\n## Summary\n- Add 3 static namespace-scoped IAM managed policies (`ns-acq`,\n`ns-full`, `ns-read`) that use `${aws:PrincipalTag/zael_namespace_id}`\nin `dynamodb:LeadingKeys` conditions for tag-based access control\n- `ns-acq`: UpdateItem on namespace prefix, read-only on `_/*` (two\nstatements); `ns-full`: full CRUD on both namespace and `_/*` prefixes;\n`ns-read`: read-only on both prefixes\n- Add 3 new CloudFormation parameters, conditions, and stack outputs for\nnamespace policy names\n- Wire namespace policy names through `StackOptions.to_parameters()`\n- Tighten `policy_name_format` max length from 122 to 120 (longest\ncomponent is `ns-full` at 7 chars)\n- Add 11 unit tests for policy actions, LeadingKeys conditions, and\nstack outputs\n\n## Test plan\n- [x] Unit tests for all 3 namespace policies (actions, conditions,\nresource patterns)\n- [x] Unit tests for CFN parameter/condition/output parity\n- [x] Unit tests for `StackOptions` model changes (policy_name_format\nlength)\n- [x] CI passes (lint, type check, unit tests)\n\nCloses #370\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
