          "message": "‚úÖ test(limiter): add namespace isolation integration tests and update CLAUDE.md (#372) (#390)\n\n## Summary\n\n- Add namespace isolation integration tests verifying entity, bucket,\nconfig, and delete operations are properly scoped per namespace using\n`RepositoryBuilder` with different namespaces\n- Update CLAUDE.md with comprehensive namespace documentation:\n`RepositoryBuilder` API, namespace registry, CLI commands, `--namespace`\nflag, two-tier IAM policy model, namespace-prefixed DynamoDB access\npatterns, and GSI4\n\n## Test plan\n\n- [x] All existing unit tests pass (`tests/unit/`)\n- [x] All existing integration tests pass (`tests/integration/`)\n- [x] New namespace isolation test passes against LocalStack\n- [x] `hatch run generate-sync` produces no diff\n- [x] `pre-commit run --all-files` passes\n- [x] `mypy src/zae_limiter/` passes with no new errors\n\nCloses #372\nCloses #362\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
