          "message": "üìù docs(schema): add namespace-prefixed keys migration guide (#371) (#391)\n\n## Summary\n- Add step-by-step migration guide for moving from bare DynamoDB keys to\nnamespace-prefixed keys (v0.10.0)\n- Include a complete Python migration script with cost estimates,\nrollback procedures, and archiver Lambda crash warning\n- Add navigation entry in `mkdocs.yml` and a link from the existing\n`docs/migrations.md` index page\n- Extend doctest infrastructure to pre-create \"my-app\" table with\nnamespace registry, enabling all 4 Python examples to execute against\nmoto\n\n## Test plan\n- [x] `uv run mkdocs build --strict` passes with no errors for the new\npage\n- [x] `uv run pytest tests/doctest/test_docs_run.py -k \"namespace-keys\"\n-v -o \"addopts=\"` ‚Äî all 4 Python examples execute successfully (not\nskipped)\n- [x] `uv run pytest tests/doctest/test_docs_run.py -v -o \"addopts=\"` ‚Äî\nfull doctest suite passes (148 passed, 32 skipped, 0 failed)\n- [x] Verify `docs/migrations/namespace-keys.md` renders correctly with\n`uv run mkdocs serve --livereload --dirty`\n- [x] Verify navigation sidebar includes Migrations > Framework +\nNamespace Keys (v0.10.0)\n- [x] Verify cross-reference link from `docs/migrations.md` resolves\ncorrectly\n\nCloses #371\n\nü§ñ Generated with [Claude Code](https://claude.ai/claude-code)",
