          "message": "‚ôªÔ∏è refactor(test): extract shared fixtures to tests/fixtures/ package (#395)\n\n## Summary\n- Extract duplicated test fixtures into a `tests/fixtures/` package with\n9 modules (`moto`, `names`, `stacks`, `repositories`, `aws_clients`,\n`polling`, `capacity`, `doctest_helpers`)\n- Convert integration/e2e/benchmark conftest files to use session-scoped\nshared CloudFormation stacks with per-test namespace isolation, reducing\n~97 stacks per LocalStack run to ~12 (88% reduction)\n- Fix `policy_name_format` bug in `test_aws_discovery.py` (10 errors\ndown to 0)\n- Eliminate all cross-module conftest imports and reduce total conftest\nlines from 1,571 to 809 (-48%)\n\n## Test plan\n- [x] Unit tests pass: `uv run pytest tests/unit/ -v`\n- [x] Integration tests pass with LocalStack: `uv run pytest\ntests/integration/ -v`\n- [x] E2E tests pass with LocalStack: `uv run pytest\ntests/e2e/test_localstack.py -v`\n- [x] Benchmark tests pass: `uv run pytest tests/benchmark/ -o\n\"addopts=\" -v`\n- [x] Doctest tests pass: `uv run pytest tests/doctest/ -v`\n- [x] No duplicated fixture code between conftest files\n- [x] Pre-commit hooks pass\n\nCloses #170\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
