          "message": "‚ö° perf(benchmark): module-scope fixtures for faster benchmark runs (#171) (#396)\n\n## Summary\n\n- Add module-scoped moto fixtures (`mock_dynamodb_module`,\n`benchmark_limiter`) and a `BenchmarkEntities` dataclass to\n`tests/benchmark/conftest.py` so entity/table setup runs once per test\nfile instead of once per test\n- Switch `test_throughput.py`, `test_latency.py`, and\n`test_operations.py` to use pre-warmed `benchmark_entities` for\nwarm-path measurements, while capacity and optimization-comparison tests\nkeep function-scoped `sync_limiter`\n- Add fixture scope selection guidance to `.claude/rules/testing.md`\nwith a decision table and module-scoped moto tips\n- Include implementation plan document in `docs/plans/`\n\n## Test plan\n\n- [x] `uv run pytest tests/benchmark/ -o \"addopts=\" -v --benchmark-only`\n‚Äî all benchmark tests pass\n- [x] `uv run pytest tests/unit/ -v` ‚Äî no regressions in unit tests\n- [x] Verify benchmark run time is reduced (baseline ~9.5s, target\n~30-50% faster)\n\nCloses #171\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
