          "message": "üêõ fix(limiter): reject namespace IDs starting with dash (#399)\n\n## Summary\n- Add a guard in `register_namespace()` to regenerate namespace IDs that\nstart with `-`, preventing Click from misinterpreting them as option\nflags in CLI commands like `namespace recover` and `namespace purge`\n- Update `CLAUDE.md` to document the dash exclusion in namespace ID\nformat\n- Add unit test verifying the regeneration behavior by mocking\n`secrets.token_urlsafe`\n\n## Test plan\n- [x] Unit test `test_register_namespace_skips_dash_prefixed_id` passes\n- [x] Generated sync code is up-to-date (`hatch run generate-sync`\nreports unchanged)\n- [x] All 2350 unit tests pass with 100% diff coverage\n- [x] CI passes\n\nCloses #398\n\nü§ñ Generated with [Claude Code](https://claude.ai/code)",
